export const isMissingParam = function (param) {
    if (param === null || param === '' || param === undefined) {
        return true;
    }
    return false;
};

export const getBoolValue = function (param) {
    if (param === 1 || param === '1') {
        return true;
    }
    return false;
};

export const difference = function (setA, setB) {
    let _difference = new Set(setA);
    for (let elem of setB) {
        _difference.delete(elem);
    }
    return _difference;
};
